const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Auth0Provider 
    domain="dev-p4v20x0cmw2351hs.us.auth0.com"
    clientId="BCC8ohOtwCULqzKvWpH8Anb1z3AHUC9p"
    authorizationParams={{
      redirect_uri: window.location.origin
